  "source": "pragma solidity ^0.4.18;\n\ncontract LevelUp{\n\n\tuint tokenPrice;\n\n\n\tstruct BuyerAddress{\n\t\tstring street;\n\t\tstring state;\n\t\tstring city;\n\t\tstring pincode;\n\t\tstring phone;\n\t}\n\tstruct Order{\n\t\tuint id;\n\t\tuint productId;\n\t\tuint orderAmount;\n\t\taddress user;\n\t\tBuyerAddress userAddress;\n\t}\n\tstruct Product{\n\t\tuint id;\n                string name;\n                string category;\n                string imageLink;\n                string descLink;\n\t\tuint price;\n\t}\n\tstruct Buyer{\n                address walletAddress;\n                uint tokens;\n        }\n\n\tmapping(address => Buyer) buyerInfo;\n\t\n\tuint public productIndex;\n\n\tuint public orderIndex;\n\n        mapping(address => mapping(uint => Product)) stores;\n        mapping(uint => address) productIdInStore;\n\tmapping(address => Order[]) buyerOrders;\t\n\n\tfunction LevelUp(uint priceToken) public{\n\t\ttokenPrice = priceToken;\n\t}\n\n\tevent NewProduct(uint _productId, string _name, string _category, string _imageLink, string _descLink, uint _price);\n\n\tevent NewOrder(uint _orderId, uint _productId, string street, string state, string city, string pincode, string phone, uint price, address user);\n\n        function addProductToStore(string _name, string _category, string _image, string _desc, uint _price) public {\n                productIndex+=1;\n\n                Product memory product = Product(productIndex, _name, _category, _image, _desc, _price);\n\n                stores[msg.sender][productIndex]=product;\n                productIdInStore[productIndex]=msg.sender;\n\n                NewProduct(productIndex, _name, _category, _image, _desc, _price);\n        }\n\n\tfunction getProduct(uint _id) view public returns (uint, string, string, string, string, uint)\n        {\n                Product memory product = stores[productIdInStore[_id]][_id];\n\n                return (product.id, product.name, product.category, product.imageLink, product.descLink, product.price);\n        }\n\n\tfunction getBuyerNumberOfOrders(address to) view public returns (uint)\n\t{\n\t\treturn buyerOrders[to].length;\n\t}\n\n\tfunction getBuyerOrder(address to, uint index) view public returns (uint, uint, uint, string, string, string, string, string)\n\t{\n\t\tOrder memory order = buyerOrders[to][index];\n\t\treturn (order.id, order.productId, order.orderAmount, order.userAddress.street, order.userAddress.state, order.userAddress.city, order.userAddress.pincode, order.userAddress.phone);\n\t}\n\n\tfunction getBuyerTokens() view public returns(uint)\n\t{\n\t\tBuyer memory buyer = buyerInfo[msg.sender];\n\t\treturn buyer.tokens;\n\t}\n\n\tfunction buyProduct(uint _productId, string _street, string _state, string _city, string _pincode, string _phone) payable public\n\t{\n\t\tProduct memory product = stores[productIdInStore[_productId]][_productId];\n\t\tBuyer memory user = buyerInfo[msg.sender];\n\n\t\tuint token = msg.value/tokenPrice;\n\n\t\trequire(token >= product.price);\n\n\t\trequire(user.tokens >= token);\n\t\n\t\torderIndex += 1;\n\t\t\n\t\tbuyerInfo[msg.sender].tokens -= token;\n\n\t\tBuyerAddress memory userAddress = BuyerAddress(_street, _state, _city, _pincode, _phone); \n\t\tOrder memory order = Order(orderIndex, _productId, token, msg.sender, userAddress);\n\n\t\tbuyerOrders[msg.sender].push(order);\n\n\t\tNewOrder(orderIndex, _productId, _street, _state, _city, _pincode, _phone, token,  msg.sender);\t\t\t\t\t\n\t}\n\n\tfunction giveLevelUpTokens(address to) payable public returns(uint)\n        {\n\t\tuint token = msg.value/tokenPrice;\n\n\t\tbuyerInfo[to].walletAddress = to;\n\t\tbuyerInfo[to].tokens += token;\n                return buyerInfo[to].tokens;\n        }\n\n}\n",
